import React, { useState, useEffect } from 'react';
import './LandingPage.css';

function LandingPage() {
  const [currentSlide, setCurrentSlide] = useState(0);
  const [theme, setTheme] = useState('default');

  const slides = [
    'https://www.adamenfroy.com/wp-content/uploads/AdobeStock_485691272.jpeg',
    'https://images.bisnis.com/upload/img/pekerjaan_freelance.png',
    'https://www.liveabout.com/thmb/dRmwxrDkQQffvSppdRQTA5h5ZnI=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/artist-working-on-painting-concentrating-in-studio--937161320-5c8f067546e0fb00016ee0e4.jpg',
    'https://www.careergirls.org/wp-content/uploads/2018/05/FashionDesigner_1920x1080.jpg',
    'https://tuhoraonline.com/wp-content/uploads/2021/04/freelancer.jpg',
  ];

  // Next Slide function
  const handleNextSlide = () => {
    setCurrentSlide((prevSlide) => (prevSlide + 1) % slides.length);
  };

  // Handle Theme Change
  const handleThemeChange = (event) => {
    setTheme(event.target.value);
  };

  // Apply theme when theme state changes
  useEffect(() => {
    const root = document.documentElement.style;
    const themeVars = {
      bakery: ['#F1C27D', '#D2691E'],
      tech: ['#4A90E2', '#FF6F61'],
      clothing: ['#C71585', '#FFD700'],
      handmade: ['#8A2BE2', '#FFD700'],
      default: ['#0d6efd', '#ffc107'],
    };

    root.setProperty('--primary-color', themeVars[theme][0]);
    root.setProperty('--accent-color', themeVars[theme][1]);
  }, [theme]);

  useEffect(() => {
    const slideInterval = setInterval(handleNextSlide, 5000);
    return () => clearInterval(slideInterval);
  }, []);

  return (
    <div>
      {/* Navigation */}
      <nav className="landing-nav">
        <div className="nav-left">
          <div className="logo">
            <i className="fas fa-brain"></i>
            <span>AI Tools</span>
          </div>
        </div>
        <div className="nav-right">
          <a href="#about" className="nav-link">About</a>
          <select id="themeSwitcher" onChange={handleThemeChange} value={theme}>
            <option value="default">Default</option>
            <option value="bakery">Bakery</option>
            <option value="tech">Tech</option>
            <option value="clothing">Clothing</option>
            <option value="handmade">Handmade</option>
          </select>
          <button className="auth-btn login-btn">Login</button>
          <button className="auth-btn signup-btn">Sign Up</button>
        </div>
      </nav>

      {/* Slideshow */}
      <div className="slideshow-container">
        {slides.map((slide, index) => (
          <div
            className={`slide ${index === currentSlide ? 'active' : ''}`}
            style={{ backgroundImage: `url(${slide})` }}
            key={index}
          >
            <div className="slide-content">
              <h1 className="slide-title">Slide {index + 1}</h1>
              <a href="theme-selector.html" className="cta-button">Get Started</a>
            </div>
          </div>
        ))}
      </div>

      {/* About Section */}
      <section id="about" className="about">
        <h2>About AI Tools</h2>
        <div className="about-grid">
          <div className="about-item">
            <i className="fas fa-magic"></i>
            <h3>AI-Powered Creation</h3>
            <p>Generate high-quality content, images, and code with state-of-the-art AI models.</p>
          </div>
          <div className="about-item">
            <i className="fas fa-bolt"></i>
            <h3>Lightning Fast</h3>
            <p>Get instant results with our optimized processing pipeline.</p>
          </div>
          <div className="about-item">
            <i className="fas fa-shield-alt"></i>
            <h3>Secure & Private</h3>
            <p>Your data is encrypted and protected with enterprise-grade security.</p>
          </div>
        </div>
      </section>
    </div>
  );
}

export default LandingPage;
